func (e *MathMLMSTYLEElement) IfDATASTAR_TEXT(condition bool, expression string) *MathMLMSTYLEElement {
	if condition {
		e.DATASTAR_TEXT(expression)
	}
	return e
}

// Binds the text content of an element to an expression.
